import './App.css';
import {BrowserRouter as Router, Route, Routes, Link} from "react-router-dom";
import { Login } from './login';
//import { Register } from './Registerjs';


function App() {
   
   return (
   
    <Router>
    
    <Routes>
        <Route exact path="/" element={<Login/>} />
        
        <Route path="/register" element={<Register/>} />
        
    </Routes>
  </Router>
    
  );
}

export default App;
